*Threads* is rolling out **direct messaging (DMs)** independent from Instagram, allowing **one-on-one chats** and basic features. 
- The new DMs aim to foster **community building** and **interest graphs**, distinct from Instagram's social graph, with features like **tags** and **topic feeds**.
- While not encrypted, Meta emphasizes that DMs are meant for *direct connection* and are part of a broader plan to enhance community engagement, with future updates planned. 

